import React from 'react'
import PropTypes from 'prop-types'
import Button from './Button'


const Header = ({ title }) => {
    return (
        <header className='header'>
            <h1>{title}</h1>
            <button color='green' text='Admin Login'></button>
        </header>
    )
}

Header.defaultProps = {
    title: 'Sha3raAir',
}

Header.propTypes = {
    title: PropTypes.string.isRequired,
}

export default Header
